import Head from 'next/head';
import Navigation from '../components/Navigation';

const MasterPage = (props) => {
    return (
        <div>
            <Head>
                <title>Portal Bitcoin</title>
            </Head>
            <Navigation />
            {props.children}
        </div>
    );
}

export default MasterPage;
